window.bookSummaryJSON = "<p>It's all supposed to be pretend. Get fake married, have a kid, prove I can have a family, and I get a billion-dollar inheritance from the father I always hated. </p> <p>It's all pretend, until I say \"I do\". And suddenly, I don't want sweet, innocent, sassy little June \"just for now\". I want her forever. </p> <p>We're supposed to play the part for the cameras and the lawyers. I'm not supposed to fall for her. I'm not supposed to want her like this. I'm not supposed to totally lose myself in claiming her body, and possessing her, and just wanting more of her. </p> <p>We faked it at the altar. But there's no faking it in the bedroom. It's all supposed to be pretend. But once I get my hands on her, she'll know I'm playing for keeps. </p> <p>I'm her first. She'll be my last. She'll be my everything, forever, even if she doesn't know it yet. </p> <p>This was all about the money at first. Now, it's all about her. </p> <p>Contains mature themes.</p>"; 
